import s from './filmCatalogPage.module.css';
import FilmElem from './FilmElem/filmElem.jsx';


var av_im = "data:image/jpeg;base64,";

const FilmCatalogPage = () =>{
  return (
    <div className={s.filmCatalogPage}>
      <div className={s.searchline}>
        <input type="text" />
        <button>Search</button>
      </div>
      <div className={s.filmList}>
        <FilmElem photo={av_im} details="Avengers" rating="7/10" />
        <FilmElem photo={av_im} details="Cars" rating="10/10" />
        <FilmElem photo={av_im} details="It" rating="8/10" />
        <FilmElem photo={av_im} details="Tokyo Revengers" rating="9/10" />
      </div>
    </div>
  );
}

export default FilmCatalogPage;
